import React from "react";
import { Link, Redirect } from "react-router-dom";
import "./Inicio.css";
import Homebtiinit from "../../assets/btinicio.png";
import axios from "axios";

var config = {};

const App = (props) => {
  const checkoutHandler = () => {
    axios.get("http://localhost:4000/api/config/session").then((res) => {
      this.config = res.data;
      console.log(config.preferencial);
    });
  };
  checkoutHandler();

  return (
    <div className="App">
      <h1>
        Peça já <br /> sua Pizza!
      </h1>

      <Link
        className="initbtbg"
        to={
          checkoutHandler() === this.config.preferencial
            ? "/select"
            : "/preferential"
        }
      >
        <img src={Homebtiinit} className="App-btn-strart" alt="logo" />
      </Link>

      <p className="IniciarP">Toque Para Iniciar</p>
    </div>
  );
};

export default App;
